void LinceUIText( LinceUILayer* ui, const char* name, float x, float y, LinceFonts font, size_t max_size, const char* text, ...
) Wrapper function that renders plain text to the screen. Parameters: LinceUILayer* ui UI state, this can be retrieved from the application state LinceGetAppState()->ui. const char* name Unique string identifier for the Nuklear window. float x X position of the text in pixels, measured from the left-end of the text box. float y Y position of the text in pixels, measred from the top of the text box. LinceFonts font Font and font size to use. See below for available fonts. size_t max_size Maximum number of characters to display. const char* text, ... String to render. This may be formatted using printf conventions and additional variadic arguments. This example renders the current delta-time and FPS to the upper left corner of the screen: void MyLayerOnUpdate(LinceLayer* layer, float dt){ LinceUILayer* ui = LinceGetAppState()->ui; /* ui, identifier, x, y, font, max, text, format varargs */ LinceUIText(ui, "FPS_indicator", 10, 10, LinceFont_Droid30, 10, "FPS %.0f", 1000.0/dt); LinceUIText(ui, "DT_indicator", 10, 40, LinceFont_Droid30, 10, "%.2f ms", dt);
}

