LinceBool LinceDispatchEvent(LinceEvent* event, LinceEventType event_type, LinceEventFn callback) Handles a given event with a callback only if it matches the given event type. Parameters: LinceEvent* event Event to dispatch LinceEventType event_type Desired type of the event to dispatch LinceEventFn callback: function that is called to handle the event if it is of the desired type. It must have the signature LinceBool callback(LinceEvent*) and should return LinceTrue (= 1) if it handled the event, and LinceFalse (= 0) otherwise. Returns: LinceBool: boolean indicates whether event has been handled and should not be propagated further. Example: LinceBool OnMouseClick(LinceEvent* e){ printf("Mouse button clicked!\n"); return LinceFalse;
} void GameOnEvent(LinceEvent* e){ LinceDispatchEvent(e, LinceEventType_MouseButtonPressed, OnMouseClick);
}

